import React from 'react';
import './ComponenteInicio.css';
import {Card, Container, ButtonGroup,ToggleButton, FormControl, Button, Form, Stack } from 'react-bootstrap';

const radios = [
  { name: 'Active', value: '1' },
  { name: 'Radio', value: '2' },
  { name: 'Radio', value: '3' },
];

const ComponenteInicio = () => {
    return (
      <Card className="text-white fondo">
         <Card.Img className='imgInicio' src={require('./src/fondoo.png')} alt="edificios" />
         <Card.ImgOverlay>  
           {/* Arreglar imagen y agregar propiedades destacadas */}
           <Container className='color-nav1'>
            <Card.Title class="wrapTitulo">Encontr√° tu Lugar</Card.Title>
              <Stack direction="horizontal" gap={3}>
              <ButtonGroup className="mb-2">
        {radios.map((radio, idx) => (
          <ToggleButton
            key={idx}
            id={`radio-${idx}`}
            type="radio"
            variant="secondary"
            name="radio"
            value={radio.value}
            checked={radioValue === radio.value}
            onChange={(e) => setRadioValue(e.currentTarget.value)}
          >
            {radio.name}
          </ToggleButton>
        ))}
      </ButtonGroup>
              </Stack>
              <Stack direction="horizontal" gap={3}>
                <Form.Select aria-label="Default select example">
                        <option>Departamento</option>
                        <option>Casa</option>
                        <option>Oficina Comercial</option>
                        <option>Local Comercial</option>
                </Form.Select>
                <Form className="d-flex">
                  <FormControl
                    type="search"
                    placeholder="Ubicacion"
                    className="me-2"
                    aria-label="Ubicacion"
                  />
                  <Button variant="primary">Buscar</Button></Form>
              </Stack>
           </Container>
         </Card.ImgOverlay>
      </Card>
  );
}

export default ComponenteInicio;

